import React, { Component } from "react";
import "./bloodbank.css";

class BloodbankBCard extends Component {
  render() {
    return (
      <div className="card">
        <table className="car-table table">
          <tbody></tbody>
        </table>
        <tr>
          <td>FFP B Rh P(0+): {this.props.ffp_Bpos}</td>
          <td>FFP B Rh N(0-): {this.props.ffp_Bneg}</td>
          <td>PC B Rh P(0+): {this.props.pc_Bpos}</td>
          <td>PC B Rh N(0-): {this.props.pc_Bneg}</td>
        </tr>
      </div>
    );
  }
}

export default BloodbankBCard;
